import React from "react";
import { useStyles } from "./styles/style";
//material-ui
import { Grid , Container } from "@material-ui/core";

import { NavLink, Route, Switch, BrowserRouter as Bro } from "react-router-dom";

export const Main = () => {
  let classes = useStyles();

  return (
    <Bro>
      <div className="main">
        <React.Fragment>
          <Container justify="center" maxWidth="md">
            
            <Grid container className={classes.cover} md={12} xs={12}>
              <Grid item md={12} xs={12} className={`p-md-3 p-3 bg-primary ${ classes.first } `} ></Grid>
              <Grid item md={12} xs={12} className={`p-md-3 p-3 bg-danger ${ classes.second } `} ></Grid>
            </Grid>
          </Container>
        </React.Fragment>
      </div>
    </Bro>
  );
};
